	set @ForAttendance = (select `sms_attendance_for` from `App_Setting`);
	set @lstatus = new.`sms_sent`;
	/*Send SMS*/
if exists (select * from `sms_apis` where `status` = 1) and @lstatus = 1 and @ForAttendance > 0 and exists (select * from `sms_templates` where `status` = 1 and `message_purpose_id` = 7) then
		set @ClassID = new.`class_id`;
set @SectionID = new.`section_id`;
set @fordate = date_format(new.`date`, '%d-%b-%y');
set @messagetext = (select `message` from `sms_templates` where `status` = 1 and `message_purpose_id` = 7);

if (@ForAttendance = 1) Or (@ForAttendance = 3) then
			Select new.`sms_sent_by`, `sc`.`mobileno`, replace(replace(replace(@messagetext, '#SN#', `si`.`name`), '#AT#', 'Present'), '#DT#', @fordate), CURDATE(), NOW(), 0, 0, 7, `si`.`id`, 0, 0 
			From `student_attendances` `sa`
			Inner Join `students` `si` on `si`.`id` = `sa`.`student_id` and `si`.`class_id` = @ClassID and `si`.`section_id` = @SectionID and `sa`.`verified_attendance_type_id` = 1
inner Join `student_contact` `sc` on `sc`.`studentid` = `si`.`id`
			Where `sa`.`date` = new.`date` and Length(ifnull(`sc`.`mobileno`,'')) = 10;
end if;
if (@ForAttendance = 1) Or (@ForAttendance = 2) then
			Select new.`sms_sent_by`, `sc`.`mobileno`, replace(replace(replace(@messagetext, '#SN#', `si`.`name`), '#AT#', 'Absent'), '#DT#', @fordate), CURDATE(), NOW(), 0, 0, 7, `si`.`id`, 0, 0 
			From `student_attendances` `sa`
			Inner Join `students` `si` on `si`.`id` = `sa`.`student_id` and `si`.`class_id` = @ClassID and `si`.`section_id` = @SectionID and `sa`.`verified_attendance_type_id` = 2 
			inner Join `student_contact` `sc` on `sc`.`studentid` = `si`.`id`
			Where `sa`.`date` = new.`date` and Length(ifnull(`sc`.`mobileno`,'')) = 10;

			Select new.`sms_sent_by`, `sc`.`mobileno`, replace(replace(replace(@messagetext, '#SN#', `si`.`name`), '#AT#', 'On Leave'), '#DT#', @fordate), CURDATE(), NOW(), 0, 0, 7, `si`.`id`, 0, 0 
			From `student_attendances` `sa`
			Inner Join `students` `si` on `si`.`id` = `sa`.`student_id` and `si`.`class_id` = @ClassID and `si`.`section_id` = @SectionID and `sa`.`verified_attendance_type_id` = 3 
			inner Join `student_contact` `sc` on `sc`.`studentid` = `si`.`id`
			Where `sa`.`date` = new.`date` and Length(ifnull(`sc`.`mobileno`,'')) = 10;
end if;
end if;

    /*Update SMS Count*/
    Update `sent_sms_detail` Set `sms_count` = CAST(mid(CAST(length(`smstext`)/160 as CHAR(5)),1,instr(CAST(length(`smstext`)/160 as CHAR(5)),'.')-1) AS UNSIGNED) + 1 Where `sms_count` = 0;

    /*Send Email*/
if exists (select * from `sms_apis` where `status` = 1) and @lstatus = 1 and @ForAttendance > 0 and exists (select * from `email_templates` where `status` = 1 and `message_purpose_id` = 7) then
		set @ClassID = new.`class_id`;
set @SectionID = new.`section_id`;
set @fordate = date_format(new.`date`, '%d-%b-%y');
set @messagetext = (select `message` from `email_templates` where `status` = 1 and `message_purpose_id` = 7);
set @emailsubjecttext = (select `subject` from `email_templates` where `status` = 1 and `message_purpose_id` = 7);

if (@ForAttendance = 1) Or (@ForAttendance = 3) then
            Select new.`sms_sent_by`, `sc`.`emailid`, @emailsubjecttext, replace(replace(replace(@messagetext, '#SN#', `si`.`name`), '#AT#', 'Present'), '#DT#', @fordate), CURDATE(), NOW(), 0, 7, `si`.`id`, 0, 0 
			From `student_attendances` `sa`
			Inner Join `students` `si` on `si`.`id` = `sa`.`student_id` and `si`.`class_id` = @ClassID and `si`.`section_id` = @SectionID and `sa`.`verified_attendance_type_id` = 1 
			inner Join `student_contact` `sc` on `sc`.`studentid` = `si`.`id`
			Where `sa`.`date` = new.`date` and length(IFNULL(`sc`.`emailid`, '')) > 0;
end if;
if (@ForAttendance = 1) Or (@ForAttendance = 2) then
            Select new.`sms_sent_by`, `sc`.`emailid`, @emailsubjecttext, replace(replace(replace(@messagetext, '#SN#', `si`.`name`), '#AT#', 'Absent'), '#DT#', @fordate), CURDATE(), NOW(), 0, 7, `si`.`id`, 0, 0 
			From `student_attendances` `sa`
			Inner Join `students` `si` on `si`.`id` = `sa`.`student_id` and `si`.`class_id` = @ClassID and `si`.`section_id` = @SectionID and `sa`.`verified_attendance_type_id` = 2 
			inner Join `student_contact` `sc` on `sc`.`studentid` = `si`.`id`
			Where `sa`.`date` = new.`date` and length(IFNULL(`sc`.`emailid`, '')) > 0;

            Select new.`sms_sent_by`, `sc`.`emailid`, @emailsubjecttext, replace(replace(replace(@messagetext, '#SN#', `si`.`name`), '#AT#', 'On Leave'), '#DT#', @fordate), CURDATE(), NOW(), 0, 7, `si`.`id`, 0, 0 
			From `student_attendances` `sa`
			Inner Join `students` `si` on `si`.`id` = `sa`.`student_id` and `si`.`class_id` = @ClassID and `si`.`section_id` = @SectionID and `sa`.`verified_attendance_type_id` = 3 
			inner Join `student_contact` `sc` on `sc`.`studentid` = `si`.`id`
			Where `sa`.`date` = new.`date` and length(IFNULL(`sc`.`emailid`, '')) > 0;

end if;
end if;
END
$$
